import React from "react";
// Icon
import TrashIcon from "../icons/delete.svg";

const DeleteButton = ({ action }) => {
    return (
        <button className="delete-button" type="button" onClick={action}>
            {TrashIcon}
        </button>
    );
};

export default DeleteButton;
